    false,nt"url": null,nt"notes": "Objectives of the 1977 field season common
    to each study site were: 1) to establish population data on waterbirds, 2) to relate
    activities such as road building, drilling operations and construction to ecological
    changes in wetlands, 3) to establish ground truth information from vegetation trend
    plots for wetland classification, 4) to measure physical and chemical characteristics
    of various wetland types for classification purposes, 5) to relate natural and artificially
    induced changes in water levels to changes in vegetation and invertebrate populations
    vital to waterbirds, 6) to document the relationship between aquatic invertebrates
    used by waterbirds and their distribution in different wetland types and 7) to evaluate
    caribou and other mammal use of the areas. Additional objectives related to habitat
    use by molting geese at Teshekpuk Lake were: 1) to identify habitat characteristics
    that make these large lakes important goose molting areas, and 2) to determine feeding
    ecology of waterfowl molting in these lakes.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
